Job Description:
We have an exciting opportunity for a Survey Draftsperson to join our team, located in Perth and Bunbury. Our team produce a variety of deliverables including Topographic Surveys, As-constructed Surveys, and various associated calculations for the land survey field teams.
We are looking for a highly motivated individual who is able to contribute in a positive and proactive manner, and is able perform the following drafting tasks, including, but not limited to:
Feature and Topographical Surveys;
Drainage and Road Open Space As Constructed Surveys;
Underground service models;

